import React, { Component } from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

class Index extends Component{
    render(){
        return(
            <div>
                <Header />
                <Footer />
            </div>
        )
    }
}




export default () => <div>Welcome to next.js</div>
